import React from 'react';
import '../../App.css';
import Footer from '../Footer';

export default function Team() {
  return (
    <>
      <div className="team-container">
        <div className="team-member">
          <img src="/images/meghan.png" alt="Meghan Weihmuller" className="team-image" />
        </div>
        <div className="team-member">
          <img src="/images/nawal.png" alt="Nawal Cheema" className="team-image" />
        </div>
        <div className="team-member">
          <img src="/images/lexi.png" alt="Lexi Kayser" className="team-image" />
        </div>
        <div className="team-member">
          <img src="/images/aakash.png" alt="Aakash Nagarapu" className="team-image" />
        </div>
      </div>
      <Footer />
    </>
  );
}
